  return (
    <div>
      <div className="register">
        <div className="inBel">
          <label htmlFor="">Title:</label>
          <input type="number"></input>
        </div>

        <div className="inBel">
          <label htmlFor="">Creator:</label>
          <input type="text"></input>
        </div>

        <div className="inBel">
          <label htmlFor="">Description:</label>
          <input type="text"></input>
        </div>

        <button>Register</button>
      </div>
    </div>
  );
}

export default Form;
